document.getElementById("changeColorBtn").addEventListener("click", function () {
   
    const randomColor = "#" + Math.floor(Math.random() * 16777215).toString(16);
    
    document.body.style.backgroundColor = randomColor;
});

const imagesForPage1 = [
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS-lweHvs84yKBuFvTRcV-kqflkP0TgeePYIQ&s",
    "https://assets.globalpartnership.org/s3fs-public/styles/hero_stories/public/2023-06/chad-education.jpg?VersionId=QhBt99jK1zKbJt8X9qi3cM7Thl1X2G_k&itok=wP9aMHho",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRDtq1Hl52HlkeHwjE4uNOqVCC0C3TIR4JEdQ&s",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTYSlotLcenPx5Kof0j1Y_5aohyD_XInjg8lg&s"
];

const imagesForPage2 = [
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSJjku0fAMf97DjgOHEOv6cOgF0gooRYSg9pA&s",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
];


const imageContainer = document.getElementById("imageContainer");


const pageId = document.body.id;

const images = pageId === "page1" ? imagesForPage1 : imagesForPage2;


images.forEach((imageUrl) => {
    const img = document.createElement("img");
    img.src = imageUrl;
    img.alt = "Grid Image";
    imageContainer.appendChild(img);
});